import React, { Component } from 'react';


class Pontuacao extends Component {
    render = () => {
        return(
            <div className={"score-container"}>
                <p className={"score-title"}>
                    Pontuação
                </p>
                <div className={"score"}>
                    <p>9.0/10.0</p>
                </div>
            </div>
        );
    }
}

export default Pontuacao;
